			i = ArtSubaId.SelectedIndex;
			g = 1;
			k = alm[artdt + 4] / 4 + 1 + i * 2;
			if (k > 2024 && k < md)
			{
				g = alm[k] / 4;
				if (g > 2024 && g < md)
				{
					ArtSubaAnim.Text = "";
					k = 0;
					while (k < 80)
					{
						if (k % 4 == 0)
						{
							fntb[0] = (byte)((alm[g] >> 24) & 0xFF);
						}
						else if (k % 4 == 1)
						{
							fntb[0] = (byte)((alm[g] >> 16) & 0xFF);
						}
						else if (k % 4 == 2)
						{
