												asc[mov] = (j + n) * 4;
												break;
											}
										}
									}
									alm[j + n] = alm[k + n];
									alm[k + n] = -86052851;
								}
								alm[j + n] = -1;
								alm[k + n] = -86052851;
								alm[j + n + 1] = 0;
								alm[k + n + 1] = -86052851;
