								{
									if (i == rnext[k * 2])
									{
										rnext[k * 2] = j * 4;
										break;
									}
								}
								break;
							}
						}
					}
					if (j >= md)
					{
						j = md;
						md += g;
						g -= 2;
						for (n = 0; n < g; n++)
						{
							alm[j + n] = alm[k + n];
							alm[k + n] = -86052851;
							n++;
							if (alm[k + n] != 0)
							{
								rmv = (k + n) * 4;
								for (mov = 0; mov < par; mov++)
								{
									if (asc[mov] == rmv)
									{
										asc[mov] = (j + n) * 4;
										break;
									}
								}
							}
							alm[j + n] = alm[k + n];
							alm[k + n] = -86052851;
						}
						alm[j + n] = -1;
						alm[k + n] = -86052851;
						alm[j + n + 1] = 0;
						alm[k + n + 1] = -86052851;
						if (EvOvrCbList.SelectedIndex == 0)
						{
							alm[dat + 20] = j * 4;
							DataOffsetList.Items[20] = "EntryActionOverride\t - 0x" + alm[dat + 20].ToString("X");
						}
						else
