		private void EvOvrListSort_Click(object sender, EventArgs e)
		{
			n = EvOvrId.Items.Count;
			if (n > 1 && n < 513)
			{
				if (EvOvrCbList.SelectedIndex == 0)
				{
					k = alm[dat + 20];
				}
				else
				{
					k = alm[dat + 21];
				}
				if (k >= 8096 && k < tds[25])
				{
					h = k / 4;
					g = h + n * 2;
					k = 0;
					i = h;
					while (i < g && alm[i] >= k)
					{
						k = alm[i];
						i += 2;
					}
					if (i < g)
					{
						i = h;
						while (i < g && (alm[i] >= 0 || alm[i] < 4095))
						{
							i += 2;
						}
						if (i == g)
						{
							for (i = h + 1; i < g; i++)
							{
								if (alm[i] >= 8096 && alm[i] < tds[25])
								{
									rmv = i * 4;
									Delasc();
								}
							}
							for (i = 0; i < n; i++)
							{
								nonam[i] = (alm[h + i * 2] << 12) + i;
							}
							while (i < 512)
							{
								nonam[i] = 268435456;
								i++;
							}
							Array.Sort(nonam);
							int[] array = new int[n];
							for (i = 0; i < n; i++)
							{
								k = (nonam[i] & 0xFFF);
								array[i] = alm[h + k * 2 + 1];
							}
							for (i = 0; i < n; i++)
							{
								alm[h + i * 2] = ((nonam[i] >> 12) & 0xFFF);
								alm[h + i * 2 + 1] = array[i];
							}
							for (i = h + 1; i < g; i++)
							{
								if (alm[i] >= 8096 && alm[i] < tds[25])
								{
									asc[par] = i * 4;
									par++;
									tds[26]++;
								}
							}
							EvOvrId.Items.Clear();
							while (alm[h] >= 0)
							{
								EvOvrId.Items.Add(alm[h].ToString("X"));
								h += 2;
								if (h >= md)
								{
									break;
								}
							}
							Fixam();
							minitxt.Text = "Sort Successed.";
							EvOvrId.SelectedIndex = 0;
							if (qe)
							{
								Qsave.Enabled = true;
							}
						}
						else
						{
							minitxt.Text = "Sort Failed.";
						}
					}
					else
					{
						minitxt.Text = "Sort Failed.";
					}
				}
				else
				{
					minitxt.Text = "Sort Failed.";
				}
			}
			else
			{
				minitxt.Text = "invalid Command.";
			}
		}

