				for (i = 0; i < g; i++)
				{
					rd2 = DataOffsetList.Items[i].ToString();
					if (rd2[0] == '-')
					{
						rd1 = rd1 + rd2 + "\r\n";
					}
					else
					{
						for (k = rd2.Length - 5; k > 5; k--)
						{
							if (rd2[k] == '-')
							{
								rd3 = rd2.Substring(k + 2);
								k -= 2;
								if (rd2[k - 2] == ' ')
								{
									k -= 3;
								}
								string text = rd1;
								rd1 = text + rd2.Substring(0, k) + "\t" + rd3 + "\r\n";
								break;
							}
						}
					}
				}
				Clipboard.SetText(rd1);
				return;
			}
			g = DMiscParam.Items.Count;
